(210, 1, '2015-01-15 17:01:57', '2015-01-15 09:01:57', '<img class="alignleft wp-image-174" src="http://upbeat.ph/wp-content/uploads/2014/09/logo.png" alt="logo" width="211" height="211" />\r\n\r\nUPBEAT Merchandise, established in 2011, is determined and committed to give quality products and items that show off the life and sense of being a true Iskolar ng at para sa bayan. Bearing the pride of the prestigious university, UPBEAT is and will be continuing to give the UP community only the best merchandise that can keep them stylish and proud.\r\n\r\nFrom Los Banos, UPBEAT has also reached UP Diliman within three years in the endeavor to spread the pride and fashion commitment that every Iskolar deserves through the establishment of its second store in Magiting street. This year, UPBEAT also would like to spread and get closer to its market by moving inside the UP Diliman campus.\r\n<p style="text-align: center;">[button link="http://upbeat.ph/contact-us/" bg_color="#ed1c24" border="#ed1c24"]Contact Us[/button]</p>', 'About', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2015-01-15 17:01:57', '2015-01-15 09:01:57', '', 64, 'http://upbeat.ph/64-revision-v1/', 0, 'revision', '', 0),
